策划:主办各种日常活动及大型活动，要求出题能力以及活动组织能力
理研:编写社刊、举办读书会和征文比赛，要求推理阅读量以及写作能力
公关:运营协会账号，编写推文设计海报，要求运营能力以及创作能力
